import React, { Component } from "react";
import styled from "styled-components";
import HideAndShow from './HideAndShow';

const FormTable = styled.form`
  margin-left: 25%;
  margin-right: 25%;
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-template-rows: repeat(10px);
  justify-content: center;
  grid-row-gap: 5px;
`;

const SubmitButton = styled.button`
  border: 0;
  color: white;
  background: greenyellow;
`;

const Logo = styled.img`
  justify-self: center;
  box-shadow: -1px 0px 0px rgba(0, 0, 0, 0.06);
  object-fit: cover;
`;

export default class ItemsTable extends Component {
  render() {
    return (
      <div>
        <FormTable>
          <SubmitButton>Items</SubmitButton>

          <SubmitButton>Items</SubmitButton>
          <Logo src="https://picsum.photos/100" />
          <SubmitButton>Items</SubmitButton>
          <Logo src="https://picsum.photos/100" />
          <SubmitButton>Items</SubmitButton>
          <Logo src="https://picsum.photos/100" />
        </FormTable>

        <HideAndShow />
      </div>
    );
  }
}
